import React, { Component } from "react";
import cards from "../components/data/db.json";
class PostData extends Component {
  render() {
    return (
      <div>
        <h1>Hello</h1>
        {cards.map((postDetails, index) => {
          return <h1>{postDetails.id}</h1>;
        })}
      </div>
    );
  }
}
export default PostData;
